openapi: 3.0.1
info:
  title: RCS Rest API 1.0
  version: "1.0"
servers:
- url: /
paths:
  /api/1/projects/{projectId}/calculate:
    post:
      operationId: Calculate
      parameters:
      - description: Project Id
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      requestBody:
        content:
          application/json-patch+json:
            schema:
              $ref: '#/components/schemas/RcsCalculationParameters'
          application/json:
            schema:
              $ref: '#/components/schemas/RcsCalculationParameters'
          text/json:
            schema:
              $ref: '#/components/schemas/RcsCalculationParameters'
          application/*+json:
            schema:
              $ref: '#/components/schemas/RcsCalculationParameters'
        description: Calculation parameters
      responses:
        "200":
          content:
            application/xml:
              schema:
                items:
                  $ref: '#/components/schemas/RcsSectionResultOverview'
                type: array
          description: Success
      summary: Calculate RCS project
      tags:
      - Calculation
  /api/1/projects/{projectId}/get-results:
    post:
      operationId: GetResults
      parameters:
      - description: Project Id
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      requestBody:
        content:
          application/json-patch+json:
            schema:
              $ref: '#/components/schemas/RcsResultParameters'
          application/json:
            schema:
              $ref: '#/components/schemas/RcsResultParameters'
          text/json:
            schema:
              $ref: '#/components/schemas/RcsResultParameters'
          application/*+json:
            schema:
              $ref: '#/components/schemas/RcsResultParameters'
        description: Calculation parameters
      responses:
        "200":
          content:
            application/xml:
              schema:
                items:
                  $ref: '#/components/schemas/RcsSectionResultDetailed'
                type: array
          description: Success
      summary: Get calculated results
      tags:
      - Calculation
  /api/1/projects/{projectId}/cross-sections/reinforced-cross-sections:
    get:
      operationId: ReinforcedCrossSections
      parameters:
      - description: ""
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      responses:
        "200":
          content:
            application/json:
              schema:
                items:
                  $ref: '#/components/schemas/RcsReinforcedCrossSection'
                type: array
          description: Success
      summary: Get reinforced cross sections
      tags:
      - CrossSection
  /api/1/projects/{projectId}/cross-sections/import-reinforced-cross-section:
    post:
      operationId: ImportReinforcedCrossSection
      parameters:
      - description: ""
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      requestBody:
        content:
          application/xml:
            schema:
              $ref: '#/components/schemas/RcsReinforcedCrossSectionImportData'
          text/xml:
            schema:
              $ref: '#/components/schemas/RcsReinforcedCrossSectionImportData'
          application/*+xml:
            schema:
              $ref: '#/components/schemas/RcsReinforcedCrossSectionImportData'
          application/json-patch+json:
            schema:
              $ref: '#/components/schemas/RcsReinforcedCrossSectionImportData'
          application/json:
            schema:
              $ref: '#/components/schemas/RcsReinforcedCrossSectionImportData'
          text/json:
            schema:
              $ref: '#/components/schemas/RcsReinforcedCrossSectionImportData'
          application/*+json:
            schema:
              $ref: '#/components/schemas/RcsReinforcedCrossSectionImportData'
        description: ""
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/RcsReinforcedCrossSection'
          description: Success
      summary: Import reinforced cross-section
      tags:
      - CrossSection
  /api/1/projects/{projectId}/design-members:
    get:
      operationId: Members
      parameters:
      - description: ""
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      responses:
        "200":
          content:
            application/json:
              schema:
                items:
                  $ref: '#/components/schemas/RcsCheckMember'
                type: array
          description: Success
      summary: Get members
      tags:
      - DesignMember
  /api/1/projects/{projectId}/sections/{sectionId}/internal-forces:
    get:
      operationId: GetSectionLoading
      parameters:
      - description: ""
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      - description: ""
        explode: false
        in: path
        name: sectionId
        required: true
        schema:
          format: int32
          type: integer
        style: simple
      responses:
        "200":
          content:
            application/json:
              schema:
                type: string
          description: Success
      summary: Get section loading
      tags:
      - InternalForces
    post:
      operationId: SetSectionLoading
      parameters:
      - description: ""
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      - description: ""
        explode: false
        in: path
        name: sectionId
        required: true
        schema:
          format: int32
          type: integer
        style: simple
      requestBody:
        content:
          application/xml:
            schema:
              $ref: '#/components/schemas/RcsSectionLoading'
          text/xml:
            schema:
              $ref: '#/components/schemas/RcsSectionLoading'
          application/*+xml:
            schema:
              $ref: '#/components/schemas/RcsSectionLoading'
          application/json-patch+json:
            schema:
              $ref: '#/components/schemas/RcsSectionLoading'
          application/json:
            schema:
              $ref: '#/components/schemas/RcsSectionLoading'
          text/json:
            schema:
              $ref: '#/components/schemas/RcsSectionLoading'
          application/*+json:
            schema:
              $ref: '#/components/schemas/RcsSectionLoading'
        description: ""
      responses:
        "200":
          content:
            application/json:
              schema:
                type: string
          description: Success
      summary: Set section loading
      tags:
      - InternalForces
  /api/1/projects/open-project:
    post:
      operationId: OpenProject
      requestBody:
        content:
          multipart/form-data:
            encoding:
              rcsFile:
                style: form
            schema:
              $ref: '#/components/schemas/OpenProject_request'
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/RcsProject'
          description: Success
      summary: Open Rcs project from rcsFile
      tags:
      - Project
  /api/1/projects/open:
    post:
      operationId: Open
      responses:
        "200":
          content:
            application/json:
              schema:
                format: uuid
                type: string
          description: Success
      tags:
      - Project
  /api/1/projects/import-iom:
    post:
      operationId: ImportIOM
      responses:
        "200":
          content:
            application/json:
              schema:
                format: uuid
                type: string
          description: Success
      tags:
      - Project
  /api/1/projects/import-iom-file:
    post:
      operationId: ImportIOMFile
      requestBody:
        content:
          application/xml:
            schema:
              $ref: '#/components/schemas/OpenModel'
          text/xml:
            schema:
              $ref: '#/components/schemas/OpenModel'
          application/*+xml:
            schema:
              $ref: '#/components/schemas/OpenModel'
          application/json-patch+json:
            schema:
              $ref: '#/components/schemas/OpenModel'
          application/json:
            schema:
              $ref: '#/components/schemas/OpenModel'
          text/json:
            schema:
              $ref: '#/components/schemas/OpenModel'
          application/*+json:
            schema:
              $ref: '#/components/schemas/OpenModel'
      responses:
        "200":
          content:
            application/json:
              schema:
                format: uuid
                type: string
          description: Success
      tags:
      - Project
  /api/1/projects/active-project:
    get:
      operationId: GetActiveProject
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/RcsProject'
          description: Success
      tags:
      - Project
  /api/1/projects/{projectId}/download:
    get:
      operationId: DownloadProject
      parameters:
      - description: The unique identifier of the opened project in the ConnectionRestApi
          service
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      responses:
        "200":
          description: Success
      summary: Download the actual rcs project from the service. It includes all changes
        which were made by previous API calls.
      tags:
      - Project
  /api/1/projects/{projectId}/code-settings:
    get:
      operationId: GetCodeSettings
      parameters:
      - explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      responses:
        "200":
          content:
            application/xml:
              schema:
                items: {}
                type: array
          description: Success
      tags:
      - Project
    put:
      operationId: UpdateCodeSettings
      parameters:
      - explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      requestBody:
        content:
          application/xml:
            schema:
              items:
                $ref: '#/components/schemas/RcsSetting'
              type: array
          text/xml:
            schema:
              items:
                $ref: '#/components/schemas/RcsSetting'
              type: array
          application/*+xml:
            schema:
              items:
                $ref: '#/components/schemas/RcsSetting'
              type: array
          application/json-patch+json:
            schema:
              items:
                $ref: '#/components/schemas/RcsSetting'
              type: array
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/RcsSetting'
              type: array
          text/json:
            schema:
              items:
                $ref: '#/components/schemas/RcsSetting'
              type: array
          application/*+json:
            schema:
              items:
                $ref: '#/components/schemas/RcsSetting'
              type: array
      responses:
        "200":
          content:
            text/plain:
              schema:
                items: {}
                type: array
            application/json:
              schema:
                items: {}
                type: array
            text/json:
              schema:
                items: {}
                type: array
          description: Success
      tags:
      - Project
  /api/1/projects/{projectId}/close:
    put:
      operationId: CloseProject
      parameters:
      - explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      responses:
        "200":
          content:
            text/plain:
              schema:
                type: string
            application/xml:
              schema:
                type: string
            text/xml:
              schema:
                type: string
            application/json:
              schema:
                type: string
            text/json:
              schema:
                type: string
          description: Success
      tags:
      - Project
  /api/1/projects/{projectId}/sections:
    get:
      operationId: Sections
      parameters:
      - description: ""
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      responses:
        "200":
          content:
            application/json:
              schema:
                items:
                  $ref: '#/components/schemas/RcsSection'
                type: array
          description: Success
      summary: Get sections
      tags:
      - Section
    put:
      operationId: UpdateSection
      parameters:
      - description: Id of the project in cache
        explode: false
        in: path
        name: projectId
        required: true
        schema:
          format: uuid
          type: string
        style: simple
      requestBody:
        content:
          application/xml:
            schema:
              $ref: '#/components/schemas/RcsSection'
          text/xml:
            schema:
              $ref: '#/components/schemas/RcsSection'
          application/*+xml:
            schema:
              $ref: '#/components/schemas/RcsSection'
          application/json-patch+json:
            schema:
              $ref: '#/components/schemas/RcsSection'
          application/json:
            schema:
              $ref: '#/components/schemas/RcsSection'
          text/json:
            schema:
              $ref: '#/components/schemas/RcsSection'
          application/*+json:
            schema:
              $ref: '#/components/schemas/RcsSection'
        description: A new reinforced section data.The value !:RcsSectionModel.Id
          defines the section in project to update
      responses:
        "200":
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/RcsSection'
          description: Success
      summary: Update a section in the RCS project
      tags:
      - Section
components:
  schemas:
    Anchor3D:
      additionalProperties: false
      description: Representation of Anchor 3D in IDEA StatiCa Detail
      example:
        id: 7
      properties:
        id:
          description: Element Id
          format: int32
          type: integer
      type: object
    AnchorGrid:
      additionalProperties: false
      description: Data of the anchor grid
      example:
        connectedParts:
        - typeName: typeName
          id: 8
          element:
            id: 9
        - typeName: typeName
          id: 8
          element:
            id: 9
        washerSize: 0.4867146239815201
        concreteBlock:
          lenght: 6.749525837406151
          material: material
          width: 4.943637496515336
          height: 0.30134145536422907
        origin:
          x: 0.8008281904610115
          "y": 6.027456183070403
          z: 1.4658129805029452
          id: 5
        shearInThread: true
        length: 7.88722683998926
        positions:
        - x: 0.8008281904610115
          "y": 6.027456183070403
          z: 1.4658129805029452
          id: 5
        - x: 0.8008281904610115
          "y": 6.027456183070403
          z: 1.4658129805029452
          id: 5
        axisZ:
          x: 4.010300976654761
          "y": 8.276461147928103
          z: 6.458262756685686
        axisY:
          x: 4.010300976654761
          "y": 8.276461147928103
          z: 6.458262756685686
        axisX:
          x: 4.010300976654761
          "y": 8.276461147928103
          z: 6.458262756685686
        name: name
        boltAssembly:
          typeName: typeName
          id: 8
          element:
            id: 9
        hookLength: 9.721723570087065
        id: 6
        anchorType: straight
        anchoringLength: 9.456612101333725
      properties:
        shearInThread:
          description: "Indicates, whether a shear plane is in the thread of a bolt."
          type: boolean
        concreteBlock:
          $ref: '#/components/schemas/ConcreteBlock'
        anchorType:
          $ref: '#/components/schemas/AnchorType'
        washerSize:
          description: Washer Size used if AnchorType is washer
          format: double
          type: number
        anchoringLength:
          description: Anchoring Length
          format: double
          type: number
        hookLength:
          description: "Length of anchor hook<br />\r\n(distance from the inner surface\
            \ of the anchor shaft to the outer tip of the hook specified as an anchor\
            \ diameter multiplier)"
          format: double
          type: number
        boltAssembly:
          $ref: '#/components/schemas/ReferenceElement'
        origin:
          $ref: '#/components/schemas/Point3D'
        axisX:
          $ref: '#/components/schemas/Vector3D'
        axisY:
          $ref: '#/components/schemas/Vector3D'
        axisZ:
          $ref: '#/components/schemas/Vector3D'
        positions:
          description: Positions of holes in the local coordinate system of the grid
          items:
            $ref: '#/components/schemas/Point3D'
          nullable: true
          type: array
        connectedParts:
          description: List of the connected parts
          items:
            $ref: '#/components/schemas/ReferenceElement'
          nullable: true
          type: array
        name:
          description: Name
          nullable: true
          type: string
        length:
          description: Length
          format: double
          type: number
        id:
          description: Element Id
          format: int32
          type: integer
      type: object
    AnchorType:
      description: Defines a type of anchor end.
      enum:
      - straight
      - washerPlateCircular
      - washerPlateRectangular
      - hook
      type: string
    ArcSegment3D:
      additionalProperties: false
      description: Represents an arc segment in three-dimensional space.
      example:
        id: 2
      properties:
        id:
          description: Element Id
          format: int32
          type: integer
      type: object
    BasePlate3D:
      additionalProperties: false
      description: Representation of Base Plate 3D in IDEA StatiCa Detail
      example:
        id: 1
      properties:
        id:
          description: Element Id
          format: int32
          type: integer
      type: object
    Beam:
      additionalProperties: false
      description: Representation of 1D member in IDEA StatiCa Detail
      example:
        id: 1
      properties:
        id:
          description: Element Id
          format: int32
          type: integer
      type: object
